        font-style: normal;
        font-family: "jetbrains-mono-light";
      }
      body,
      html {
        margin: 0;
        width: 100%;
        height: 100%;
        overflow: hidden;
        font-synthesis: none;
        text-rendering: optimizeLegibility;
        -webkit-font-smoothing: antialiased;
        -moz-osx-font-smoothing: grayscale;
      }
      .bg-color {
        background-color: #ffffff;
      }
      @media (prefers-color-scheme: dark) {
        .bg-color {
          background-color: #292f36;
        }
      }
      @keyframes fade-in {
        0% {
          opacity: 0;
        }
        100% {
          opacity: 1;
        }
      }
      .show-after-init {
        visibility: hidden;
        animation: fade-in 1s ease-out;
      }
      .flex {
        display: flex;
      }
      .flex.flex-row {
        flex-direction: row;
      }
      .flex.items-center {
        align-items: center;
      }
      .flex.justify-center {
        justify-content: center;
      }
      .bezel {
        display: inline-block;
        border-width: 2rem;
        border-style: solid;
        border-color: #dfe6eb;
        overflow: hidden;
      }
      @media (prefers-color-scheme: dark) {
        .bezel {
          border-color: #1e2229;
        }
      }
      .bezel-classic {
        background: linear-gradient(
          45deg,
          #000000 45%,
          #2e2e2e 47%,
          #000000 55%
        );
      }
      .rounded-lg {
        border-radius: 0.5rem;
      }
      .rounded-full {
        border-radius: 9999px;
      }
      .ring {
        outline: solid 1px #aeb4b7;
      }
      @media (prefers-color-scheme: dark) {
        .ring {
          outline: solid 1px #46505c;
        }
      }
      canvas {
        animation: fade-in 0.3s linear;
        display: block;
        aspect-ratio: (800 / 480);
      }
      .fit-w {
        width: calc(100dvw - 5rem);
      }
      .fit-h {
        height: calc(100dvh - 5rem);
      }
      .overlay {
        position: fixed;
        top: 0;
        left: 0;
        width: 100%;
        height: 10rem;
        background-color: rgba(0, 0, 0, 0.8);
        transition: height 0.5s;
        overflow: auto;
        z-index: 999;
      }
      @media (prefers-color-scheme: dark) {
        .overlay {
          background-color: rgba(0, 0, 0, 0.6);
        }
      }
      .overlay.collapsed {
        height: 0rem;
        overflow: hidden;
      }
      .overlay-content {
        padding: 0.75rem;
        color: white;
        font-family: "jetbrains-mono-light", monospace;
        font-weight: 600;
      }
      .overlay.collapsed .overlay-content {
        display: none; /* Hide the content when collapsed */
      }
      .icon {
        height: 2rem;
        width: 2rem;
        color: white;
        display: inline-block;
        vertical-align: middle;
      }
      p {
        margin: 0px;
        font-size: 1rem;
        line-height: 120%;
        word-wrap: break-word;
      }
      button {
        position: fixed;
        right: 1rem;
        bottom: 1rem;
        z-index: 999;
        background: none;
        color: inherit;
        border: none;
        padding: 0;
        font: inherit;
        cursor: pointer;
        outline: inherit;
        height: 2.25rem;
        width: 2.25rem;
        border-radius: 0.5rem;
        mix-blend-mode: difference;
      }
      .hover\:bg-light-enabled-fill:hover {
        background-color: rgba(240, 244, 248, 0.3);
      }
      .active\:bg-light-disabled-fill:active {
        background-color: rgba(181, 195, 209, 0.3);
      }
      @media (prefers-color-scheme: dark) {
        .dark\:hover\:bg-dark-enabled-fill:hover {
          background-color: rgba(65, 73, 86, 0.3);
        }
      }
      @media (prefers-color-scheme: dark) {
        .dark\:active\:bg-dark-disabled-fill:active {
          background-color: rgba(51, 58, 68, 0.3);
        }
      }
      ::-webkit-scrollbar {
        width: 0.5rem;
        height: 0.5rem;
      }
      ::-webkit-scrollbar-track {
        background: #b5c3d160;
        border-radius: 0.375rem;
      }
      ::-webkit-scrollbar-thumb {
        background: #b5c3d1a0;
        border-radius: 0.375rem;
      }
      ::-webkit-scrollbar-thumb:hover {
        background: #b5c3d1f0;
      }
      ::-webkit-scrollbar-corner {
        background: #c7d0dc;
      }

      @media (prefers-color-scheme: dark) {
        ::-webkit-scrollbar-track {
          background: #4e555f60;
        }
        ::-webkit-scrollbar-thumb {
          background: #4e555ff0;
        }
        ::-webkit-scrollbar-thumb:hover {
          background: #4e555fa0;
        }
        ::-webkit-scrollbar-corner {
          background: #4c545d;
        }
      }
    </style>
